import React, { Component } from "react";
class Delete extends Component {
  constructor(props) {
    super(props);
    this.state = {
      images: [],
    };
  }
  state = {};
  fetchImages = () => {
    fetch("https://server-for-mcgill-display.herokuapp.com/delete")
      .then((response) => {
        return response.json();
      })
      .then((body) => {
        let elementstring = body.message;
        this.setState({ images: elementstring.trim().split(/\s+/) });
      })
      .catch((error) => {
        console.log("Error");
      });
      console.log("hello")
  }
  componentDidMount(){
    this.fetchImages();
  }
  render() {
    return (
      <div>
        <h1>View and delete current posts</h1>
        <cardsForDisplay elementstring = {this.state.images} />
      </div>
    );
  }
}
function cardsForDisplay(props){
  let cardList = []
  let elementstring = props.elementstring;
    elementstring.forEach(element => {
    console.log(element)
    cardList.push(
      <div className="card">
        <img src={element}></img>
      </div>
    )
  });
}
export default Delete;
